INSERT INTO TB_BOARD VALUES (1,'아침 이벤트 하나요?',1,'월요일부터 금요일까지 역삼역 근처 편의점에서 아침 할인 이벤트 하나요? 하면 편의점마다 얼마씩 하는지 알 수 있을까요? 점포마다 차이가 나는 건가요?',SYSDATE,0,NULL,NULL, DEFAULT); /* 사용자 - 일반 사용자*/
